/*Table structure for table `jira_types` */

DROP TABLE IF EXISTS `jira_types`;

CREATE TABLE `jira_types` (
  `jira_type_id` int(11) NOT NULL AUTO_INCREMENT,
  `jira_type` varchar(255) NOT NULL,
  PRIMARY KEY (`jira_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;

/*Data for the table `jira_types` */

insert  into `jira_types`(`jira_type_id`,`jira_type`) values 
(1,'Epic'),
(2,'Story');

/*Table structure for table `logs` */

DROP TABLE IF EXISTS `logs`;

CREATE TABLE `logs` (
  `log_id` int(11) NOT NULL AUTO_INCREMENT,
  `file_name` varchar(255) DEFAULT NULL,
  `old_value` text DEFAULT NULL,
  `new_value` text DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `timestamp` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`log_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `logs` */

/*Table structure for table `manual_types` */

DROP TABLE IF EXISTS `manual_types`;

CREATE TABLE `manual_types` (
  `manual_type_id` int(11) NOT NULL AUTO_INCREMENT,
  `manual_type_name` varchar(255) NOT NULL,
  PRIMARY KEY (`manual_type_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `manual_types` */

/*Table structure for table `query_log` */

DROP TABLE IF EXISTS `query_log`;

CREATE TABLE `query_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `timestamp` datetime DEFAULT NULL,
  `action` enum('INSERT','UPDATE') DEFAULT NULL,
  `report_id` varchar(20) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `file_name` varchar(255) DEFAULT NULL,
  `field_name` varchar(255) DEFAULT NULL,
  `old_value` varchar(255) DEFAULT NULL,
  `new_value` varchar(255) DEFAULT NULL,
  `assignment_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4;

