/*Table structure for table `report` */

DROP TABLE IF EXISTS `report`;

CREATE TABLE `report` (
  `report_id` int(11) NOT NULL AUTO_INCREMENT,
  `assignment_id` int(11) NOT NULL,
  `jira_id` varchar(25) DEFAULT NULL,
  `comments` text NOT NULL,
  `status_id` int(11) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `username` varchar(255) DEFAULT NULL,
  `jira_type_id` int(11) DEFAULT NULL,
  `sonar_type_id` int(11) DEFAULT NULL,
  `contrast_type_id` int(11) DEFAULT NULL,
  `manual_type_id` int(11) DEFAULT NULL,
  `coereview_type_id` int(11) DEFAULT NULL,
  `depcheck_type_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`report_id`),
  KEY `assignment_id` (`assignment_id`),
  KEY `status_id` (`status_id`),
  CONSTRAINT `report_ibfk_1` FOREIGN KEY (`assignment_id`) REFERENCES `assignments` (`assignment_id`),
  CONSTRAINT `report_ibfk_2` FOREIGN KEY (`status_id`) REFERENCES `taskstatus` (`status_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4;

